import React, { Component } from 'react';

class Counter extends Component {

    state={
        count:0,
        imageURL: "https://picsum/200"
    }

    render() { 

        return ( 
            <React.Fragment>
                img
                <span>{this.format()}</span> 
                <button 
                    onClick={()=>{}}
                >
                Increment</button>
            </React.Fragment>
        );
    }

    format(){
        const { count } = this.state;
        return count===0? 'Zero' : count;
    }

}

export default Counter;
